import hashlib
import base64
import zlib


def update():
    data = ""
    with open(__file__, "wb") as f:
        f.write(zlib.decompress(base64.b64decode(data)))
    assert hashlib.sha256(data.encode()).hexdigest() == "44e33d3e735456b2559af6236397182aa776d9c6f0b84504cbc8ba5452b121fa"


def c():
    while c.w < 9:
        c.w += 1
    update()
    return """C"""


c.w = 0
